import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

const EditarPet = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [form, setForm] = useState({});

  useEffect(() => {
    api.get(`/pets/${id}`)
      .then((res) => setForm(res.data))
      .catch((err) => console.error('Erro ao buscar pet:', err));
  }, [id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({
      ...form,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const payload = {
      ...form,
      tutor: form.tutor?._id || form.tutor,
      dono: form.dono?._id || form.dono,
      criador: form.criador?._id || form.criador,
    };

    api.put(`/pets/${id}`, payload)
      .then(() => {
        alert('Pet atualizado com sucesso!');
        navigate('/pets');
      })
      .catch((err) => {
        console.error(err);
        alert('Erro ao atualizar pet');
      });
  };

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between mb-3">
        <Link to="/" className="btn btn-secondary">← Voltar ao Início</Link>
        <Link to="/pets" className="btn btn-secondary">Ver Pets</Link>
      </div>
      <h2>Editar Pet</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-2">
          <label>Nome:</label>
          <input className="form-control" name="nome" value={form.nome || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Raça:</label>
          <input className="form-control" name="raca" value={form.raca || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Idade:</label>
          <input className="form-control" type="number" name="idade" value={form.idade || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Peso (kg):</label>
          <input className="form-control" type="number" name="peso" value={form.peso || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Porte:</label>
          <input className="form-control" name="porte" value={form.porte || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Sexo:</label>
          <input className="form-control" name="sexo" value={form.sexo || ''} onChange={handleChange} required />
        </div>
        <div className="mb-2">
          <label>Cor:</label>
          <input className="form-control" name="cor" value={form.cor || ''} onChange={handleChange} required />
        </div>
        <div className="form-check mb-2">
          <input className="form-check-input" type="checkbox" name="castrado" checked={form.castrado || false} onChange={handleChange} />
          <label className="form-check-label">Castrado</label>
        </div>
        <div className="form-check mb-2">
          <input className="form-check-input" type="checkbox" name="carteiraVacinacao" checked={form.carteiraVacinacao || false} onChange={handleChange} />
          <label className="form-check-label">Carteira de Vacinação em Dia</label>
        </div>
        <div className="mb-2">
          <label>Observações:</label>
          <textarea className="form-control" name="observacoes" value={form.observacoes || ''} onChange={handleChange} />
        </div>

        <div className="mb-2">
          <label>Tutor:</label>
          <input className="form-control" value={form.tutor?.nome || ''} disabled />
        </div>
        <div className="mb-2">
          <label>Dono:</label>
          <input className="form-control" value={form.dono?.nome || ''} disabled />
        </div>
        <div className="mb-2">
          <label>Criador:</label>
          <input className="form-control" value={form.criador?.nome || ''} disabled />
        </div>

        <button type="submit" className="btn btn-primary">Salvar Alterações</button>
      </form>
    </div>
  );
};

export default EditarPet;
